import React from 'react'

function Box({}) {

  return (
    <div className='w-3/5 h-96 bg-cyan-400 shadow-lg rounded-2xl'>
        <header>
          {header}
        </header>
        <div>
          {body}
        </div>
    </div>
  )
}

export default Box
